import React, { Component } from 'react';
import './portfolio.css';

import { useState } from 'react';
import frontEndTutoril from './frontEndTutoril';
import reactTutoril from './reactTutoril';
import graphicDesigning from './graphicDesigning';
import graphicVideov from './graphicVideos';


// Do NOT USE THE IMAGES IN PRODUCTION


function Portfolio() {
     
      const [toggleState, setToggleState] = useState(1);

      const toogleTab = (index) => {
        setToggleState(index);
      }
        return (
             <section id='portfolio' >
               <h5>My React Work</h5>
               <h2>Portfolio</h2>
                <div className='block-tabs'>
                  <div className={toggleState === 1 ? "tabs active-tabs" : "tabs"}
                   onClick={() =>toogleTab(1)}>Front end development </div>

                  <div className={toggleState === 2 ? "tabs active-tabs" : "tabs"} 
                  onClick={() =>toogleTab(2)}>React Js Development</div>
                
                  <div className={toggleState === 3 ? "tabs active-tabs" : "tabs"} 
                  onClick={() =>toogleTab(3)}>Graphic Designing</div>
                </div>
                <div className={toggleState === 1 ? "content active-content" : "content"}>
                <frontEndTutoril/>
                </div>
                <div className={toggleState === 2 ? "content active-content" : "content"}>
                <reactTutoril/>
                </div>
                <div className={toggleState === 3 ? "content active-content" : "content"}>
                <graphDesiging/>
                </div>
                <div className={toggleState === 4 ? "content active-content" : "content"}>
                <graphicVideo/>
                </div>
                

            </section> 
        )
    };
export default Portfolio;
